import styled from "styled-components";

export const CarouselContainer = styled.div`
	display: flex;
	flex-direction: row;
`;

export const CarouselData = styled.div`
	display: flex;
	flex-direction: row;
	-webkit-transition: opacity 5s ease;

	transition: opacity 5s ease;
`;
